  var date ="";
  var fieldn ="";
  const classes = useStyles();
  const [expanded, setExpanded] = React.useState(false);

  const handleExpandClick = () => {
    setExpanded(!expanded);
  };
  const nameref = useFirestore()
  .collection('test')
  .doc('Conestoga');
  const firedata :any= useFirestoreDocData(nameref);
