  var collegen ="loading..";
  var coursen ="loading..";
  var date ="loading..";
  var fieldn ="loading..";
}
 return(
   <Card className={classes.root}>
        <CardHeader
          avatar={
            <Avatar aria-label="recipe" className={classes.avatar}>
              E
            </Avatar>
          }

          title="Education"
          subheader=""
        />

        <CardContent>
          <Typography color="textSecondary" component="p">
          <table>

          <div className={classes.collegen}>{collegen}</div>

          <div className={classes.coursen}>{coursen}</div>
          <div className={classes.daten}>{date}</div>
          <div className={classes.fieldn}>{fieldn}</div>
          </table>

          </Typography>
        </CardContent>


      </Card>
 )
  //return <p>{about}</p>;
}



export default Education;
